import React from 'react'
import {Link} from 'react-router-dom';

export default function Listitem({coin}) {
  return (
    <div className='home-cryto'>
        <Link to={`/${coin.id}`}>
            <div className="home-cryto-image"></div>
            <div className="home-cryto-name">{coin.name}</div>
            <div className="home-cryto-prices"></div>
        </Link>
     </div>
  )
}
